import React from "react";
import { Link } from "react-router-dom";
import { useState, useEffect } from "react";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import Modal from "react-modal";
import {
  faCartShopping,
  faMagnifyingGlass,
  faUser,
  faBarsStaggered,
  faBagShopping,
} from "@fortawesome/free-solid-svg-icons";

const Navbar = () => {
  const [modalIsOpen, setModalIsOpen] = useState(false);
  const modalStyle = {
    overlay: {
      transition: "transform 0.5s ease",
      transform: "translateY(-100%)",
      backgroundColor: "rgba(0, 0, 0, 0.5)", // 배경색과 투명도
    },
    content: {
      width: "50%", // 모달의 너비
      height: "50%", // 모달의 높이
      margin: "auto", // 가운데 정렬
      border: "1px solid #ccc", // 테두리
      borderRadius: "8px", // 모서리 반경
      padding: "20px", // 내부 여백
      backgroundColor: "#fff", // 배경색
    },
  };

  return (
    <div className="black-nav">
      <div className="left">
        <FontAwesomeIcon icon={faUser} className="icons" />
      </div>
      <h1 className="center">
        <Link to="/">
          <img
            src="https://i.imgur.com/F8FF2Zk.png"
            width={40}
            height={60}
            className="logo"
          ></img>
        </Link>
      </h1>
      <div className="right">
        <FontAwesomeIcon icon={faMagnifyingGlass} className="icons" />
        <Link to="/cart">
          <FontAwesomeIcon icon={faCartShopping} className="icons" />
        </Link>
        <FontAwesomeIcon
          icon={faBarsStaggered}
          className="icons"
          onClick={() => setModalIsOpen(!modalIsOpen)}
        />
        <Modal
          isOpen={modalIsOpen}
          onRequestClose={() => setModalIsOpen(false)}
          style={modalStyle}
        >
          This is Modal content
        </Modal>
      </div>
    </div>
  );
};

export default Navbar;
